
document.addEventListener('DOMContentLoaded', () => {
    populateDatalist('dropdown1-options', options);
    populateDatalist('dropdown2-options', options);
});


function populateDatalist(datalistId, options) {
    const datalist = document.getElementById(datalistId);
    options.forEach(option => {
        const opt = document.createElement('option');
        opt.value = option;
        datalist.appendChild(opt);
    });
}


function handleButtonClick() {
    const dropdown1 = document.getElementById('dropdown1').value;
    const dropdown2 = document.getElementById('dropdown2').value;

    const index1 = options.indexOf(dropdown1);
    const index2 = options.indexOf(dropdown2);

    // Get the values for the selected options
    const val1 = vals[index1];
    const val2 = vals[index2];
    const mean_val = val1.map((v, i) => (v + val2[i]) / 2);

    // calculate the cosine similarity of mean_val to all the other values
    const similarities = vals.map((val, i) => {
        const dotProduct = val.reduce((acc, v, j) => acc + v * mean_val[j], 0);
        const mag1 = Math.sqrt(val.reduce((acc, v) => acc + v * v, 0));
        const mag2 = Math.sqrt(mean_val.reduce((acc, v) => acc + v * v, 0));
        return 10 * dotProduct / (mag1 * mag2);
    });

    // exclude the selected values
    similarities[index1] = -Infinity;
    similarities[index2] = -Infinity;

    // select the top 20 most similar values
    const top20 = similarities
        .map((similarity, i) => ({ similarity, value: options[i] }))
        .sort((a, b) => b.similarity - a.similarity)
        .slice(0, 20);


    // convert likelihoods to probabilities using softmax
    const exps = top20.map(({ similarity }) => Math.exp(similarity));
    const sumExps = exps.reduce((acc, exp) => acc + exp, 0);
    const probabilities = exps.map(exp => exp / sumExps);

    // log the top 20 most similar values and their probabilities
    console.log(top20.map(({ value }, i) => `${value}: ${probabilities[i]}`));

    // display random value from top 20 given the probabilities
    const rand = Math.random();
    let sum = 0;
    let selectedValue;
    for (let i = 0; i < probabilities.length; i++) {
        sum += probabilities[i];
        if (rand <= sum) {
            selectedValue = top20[i].value;
            break;
        }
    }

    const selectedValueIndex = options.indexOf(selectedValue);

    // calculate the cosine similarity of the selected value to the two selected values
    let perc1 = 1 + vals[selectedValueIndex].reduce((acc, v, i) => acc + v * val1[i], 0) / (Math.sqrt(vals[selectedValueIndex].reduce((acc, v) => acc + v * v, 0)) * Math.sqrt(val1.reduce((acc, v) => acc + v * v, 0)));
    let perc2 = 1 + vals[selectedValueIndex].reduce((acc, v, i) => acc + v * val2[i], 0) / (Math.sqrt(vals[selectedValueIndex].reduce((acc, v) => acc + v * v, 0)) * Math.sqrt(val2.reduce((acc, v) => acc + v * v, 0)));

    w = perc1 + perc2;
    console.log(w, perc1, perc2);
    perc1 = Math.round(100 * perc1 / w);
    perc2 = Math.round(100 * perc2 / w);
    console.log(perc1, perc2);

    // display the selected value and the similarities sim_p1 and sim_p2
    document.getElementById('result').textContent = `Selected value: ${selectedValue}\nSimilarity to ${dropdown1}: ${perc1}\nSimilarity to ${dropdown2}: ${perc2}`;

}

